import numpy as np
from scipy.stats import pearsonr

# 获取 numpy 数组
adv_np = advantages.cpu().numpy()
pr_np  = prm_reward.cpu().numpy()

# 只取前 150 个
adv_slice = adv_np[:150]
pr_slice  = pr_np[:150]

# 对 pr_slice 做 softmax 归一化，变成合法的“概率分布”
exp_pr = np.exp(pr_slice - np.max(pr_slice))
probs  = exp_pr / exp_pr.sum()

# 计算每个 token 的熵
entropy = -(probs * np.log(probs + 1e-12))

# 再做 Pearson 相关
r_ent, p_ent = pearsonr(entropy, adv_slice)
print(f"Pearson r (entropy vs. advantage) on first 150 tokens: {r_ent:.4f}, p-value = {p_ent:.3g}")
